import styles from "../scss/BlogDetail.module.scss";
import Wrapper from "../helper/Wrapper";
import p1 from '../../img/images/dexuat.png';
import { Col, Row } from "react-bootstrap";
const BlogDetail = () => {
  return (
    <Wrapper>
        <Row>
      <div>
        <img src={p1}/>
      </div>
      </Row>
    </Wrapper>
  );
};

export default BlogDetail;
